import React,{useContext} from 'react'
import background from './Images/background.jpg'
function Home() {
  return (
      <div className="row" style={{padding:"20px",position:"relative"}}>
       <div style={{backgroundImage:`url(${background})`,backgroundRepeat:"no-repeat",backgroundSize:"cover",height:"95vh",width:"100%",position:"absolute"}}></div>
      </div>
  )
}

export default Home
